const MOD = 1_000_000_007;

function countNicePairs(nums: number[]): number {
  nums.sort((a, b) => a - b);
  let nicePairs = 0;
  const revs = new Map<number, number>();
  for (let i = 0; i < nums.length; i++) {
    const key = rev(nums[i]) - nums[i];
    const sameKeyCount = revs.get(key) ?? 0;
    nicePairs = (nicePairs + sameKeyCount) % MOD;
    revs.set(key, sameKeyCount + 1);
  }
  return nicePairs;
}

function rev(num: number) {
  let reversed = 0;
  while (num > 0) {
    reversed = reversed * 10 + num % 10;
    num = Math.trunc(num / 10);
  }
  return reversed;
}

